export type SvgIconType = keyof typeof SVG_ICON_LIB;

// Temporary class helper to support icons that not included into font.
export default function SvgIcon(iconName: SvgIconType, ...classes: string[]) {
  const span = document.createElement('span');
  span.classList.add('svg-icon', ...classes);

  const svgIcon = (SVG_ICON_LIB[iconName] as Node).cloneNode(true);
  if(svgIcon) {
    span.appendChild(svgIcon as HTMLElement);
  }

  return span;
}
